import VerificationInput from "react-verification-input";

const TwoFactor = () => {
    return(
        <>
            <VerificationInput
                length={6}
                validChars="0-9"
                value=""
                inputProps={{ autoComplete: "one-time-code" }}
            />
        </>
    );
}

export default TwoFactor;
